import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import './gallery-button.css';

type GalleryButtonProp = {
    galleryName: string;
    imageSrc: string;
    alt: string;
    to: string;
}

class GalleryButton extends Component<GalleryButtonProp, {}> {
    render() {
        return (
            <Link className="gallery-button" to={this.props.to}>
                <div className="image-container">
                    <img src={this.props.imageSrc} alt={this.props.alt}/>
                </div>
                <div className="gallery-name">
                    <p>{this.props.galleryName}</p>
                </div>
            </Link>
        )
    }
}

export default GalleryButton;
